const Card = (props) => {
    const [initialValue, setInitialValue] = useState("backgroundImage")
    return (
        <h1>
        <button onClick={()=> setInitialValue(initialValue.cardImage)}>Click me</button>
        {props.rank}
        {props.suit}
        {props.cardImage}



        </h1>
    );
};

export default Card;
